// Taxi class
case class Taxi(                            // column index
    _id: String,                            // 0
    _rev: String,                           // 1
    dropoff_datetime: java.sql.Timestamp,   // 2
    dropoff_latitude: Double,               // 3
    dropoff_longitude: Double,              // 4  
    hack_license: String,                   // 5
    medallion: String,                      // 6
    passenger_count: Integer,               // 7
    pickup_datetime: java.sql.Timestamp,    // 8
    pickup_latitude: Double,                // 9
    pickup_longitude: Double,               // 10
    rate_code: Integer,                     // 11
    store_and_fwd_flag: String,             // 12
    trip_distance: Double,                  // 13
    trip_time_in_secs: Integer,             // 14
    vendor_id: String                       // 15
  )

// patching the String class with new functions that have a defualt value if conversion to another type fails.
implicit class StringConversion(val s: String) {
def toTypeOrElse[T](convert: String=>T, defaultVal: T) = try {
    if (s matches "[\\+\\-0-9.eE]+") 
        convert(s)
    else 
        defaultVal
  } catch {
    case _: NumberFormatException => defaultVal
  }

  def toIntOrElse(defaultVal: Int = 0) = toTypeOrElse[Int](_.toInt, defaultVal)
  def toDoubleOrElse(defaultVal: Double = 0D) = toTypeOrElse[Double](_.toDouble, defaultVal)
}

// clean up Taxi fields and convert them to proper formats
def getTaxiCleaned(row:Array[String]):Taxi = {
  return Taxi(
    row(0).replaceAll("\"", ""),
    row(1).replaceAll("\"", ""),
    Timestamp.valueOf(row(2).replaceAll("\"", "")),
    row(3).toDoubleOrElse(0),
    row(4).toDoubleOrElse(0),
    row(5).replaceAll("\"", ""),
    row(6).replaceAll("\"", ""),
    row(7).toIntOrElse(0),
    Timestamp.valueOf(row(8).replaceAll("\"", "")),
    row(9).toDoubleOrElse(0),
    row(10).toDoubleOrElse(0),
    row(11).toIntOrElse(0),
    row(12).replaceAll("\"", ""),
    row(13).toDoubleOrElse(0),
    row(14).toIntOrElse(0),
    row(15).replaceAll("\"", "")
  )
}

